import "./Cell_styles.scss";
import React, { useState } from "react";

const Cell = () => {
  const [checked, setChecked] = useState(false);

  return (
    <div>
      <div
        className="cell"
        onClick={() => {
          if (checked === false) {
            setChecked(true);
            console.log("a cell was checked");
          } else {
            return;
          }
        }}
      >
        <p className="cell_text">This is the cell text</p>
      </div>
    </div>
  );
};

export default Cell;
